import Base from "../components/Base";
import { Card, CardBody, CardHeader, Container, Form, FormGroup, Input, Label } from "reactstrap";

const Signup = () => {
  return (
    <Base>
      <Container>
        <Card>
          <CardHeader>
            <h3>Register</h3>
          </CardHeader>
			<CardBody>
				{/* Creating form */}
				<Form>
					<FormGroup>
						<Label form="name">Enter Name</Label>
						<Input type="text" id="name" placeholder="Enter name"></Input>
					</FormGroup>
				</Form>
			</CardBody>
        </Card>
      </Container>
    </Base>
  );
};

export default Signup;
